pragma solidity >=0.4.22 <0.9.0;

contract MartketPlace{
    enum ShippingStatus{ PENDING, SHIPPED, DELIVERED }
    ShippingStatus status;
    address owner;
    address customer;

    event MissionComplete();

    constructor(address _customer) public {
        owner = msg.sender;
        customer = _customer;
        status = ShippingStatus.PENDING;
    }

    function Shipped() public {
        require(msg.sender == owner);
        status = ShippingStatus.SHIPPED;
    }

    function Delivered() public {
        require(msg.sender == owner);
        status = ShippingStatus.DELIVERED;
        emit MissionComplete();
    }

    function getStatus() public view returns(ShippingStatus){
        require(msg.sender == owner);  
        return status;
    }

    function Status() public view returns(ShippingStatus){
        require(msg.sender != owner);
        return status;
    }

}
